import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <ul>
                <li>
                    <a href="/">home</a>
                </li>
            </ul>
        )
    }
}

Header.getInitialProps = ({ query }) => {
    return query;
}

export default Header;
